import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Courses from './pages/Courses';
import CourseDetail from './pages/CourseDetail';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './pages/Profile';
import Assessments from './pages/Assessments';
import AssessmentDetail from './pages/AssessmentDetail';
import AssessmentResult from './pages/AssessmentResult';
import Dashboard from './pages/Dashboard';
import CourseModule from './pages/CourseModule';
import AdminDashboard from './pages/admin/Dashboard';
import AdminUploadCourse from './pages/admin/UploadCourse';
import AdminUploadAssessment from './pages/admin/UploadAssessment';
import AdminUsers from './pages/admin/Users';
import AdminAnalytics from './pages/admin/Analytics';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Toaster position="top-right" />
        <div className="min-h-screen bg-gray-100">
          <Navbar />
          <main className="container mx-auto px-4 py-8">
            <Routes>
              {/* Public Routes */}
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* Protected Routes */}
              <Route path="/dashboard" element={
                <ProtectedRoute>
                  <Dashboard />
                </ProtectedRoute>
              } />
              <Route path="/courses" element={
                <ProtectedRoute>
                  <Courses />
                </ProtectedRoute>
              } />
              <Route path="/courses/:id" element={
                <ProtectedRoute>
                  <CourseDetail />
                </ProtectedRoute>
              } />
              <Route path="/courses/:id/module/:moduleId" element={
                <ProtectedRoute>
                  <CourseModule />
                </ProtectedRoute>
              } />
              <Route path="/profile" element={
                <ProtectedRoute>
                  <Profile />
                </ProtectedRoute>
              } />
              <Route path="/assessments" element={
                <ProtectedRoute>
                  <Assessments />
                </ProtectedRoute>
              } />
              <Route path="/assessments/:id" element={
                <ProtectedRoute>
                  <AssessmentDetail />
                </ProtectedRoute>
              } />
              <Route path="/assessments/:id/result" element={
                <ProtectedRoute>
                  <AssessmentResult />
                </ProtectedRoute>
              } />

              {/* Admin Routes */}
              <Route path="/admin" element={
                <ProtectedRoute>
                  <AdminDashboard />
                </ProtectedRoute>
              } />
              <Route path="/admin/upload-course" element={
                <ProtectedRoute>
                  <AdminUploadCourse />
                </ProtectedRoute>
              } />
              <Route path="/admin/upload-assessment" element={
                <ProtectedRoute>
                  <AdminUploadAssessment />
                </ProtectedRoute>
              } />
              <Route path="/admin/users" element={
                <ProtectedRoute>
                  <AdminUsers />
                </ProtectedRoute>
              } />
              <Route path="/admin/analytics" element={
                <ProtectedRoute>
                  <AdminAnalytics />
                </ProtectedRoute>
              } />
            </Routes>
          </main>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
